import React from "react";
import { useRef } from "react";
import "../css/common-class.css";
import { Link } from "react-router-dom";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Pagination } from "swiper/modules";

import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

const HomePage = () => {
  const products = [
    {
      id: 1,
      image: "assets/product-car.jpg",
      title: "Audi A1 Sportback",
      description: "1.2 TFSI Admired | S- LINE | AIRCO ...",
      year: "2015",
      fuel: "Benzine",
      transmission: "Handmatig",
      price: "€ 96.950,-",
      monthly: "€ 401 per maand"
    },
    // ... other products
  ];

  const navigationPrevRef = useRef(null);
  const navigationNextRef = useRef(null);

  return (
    <main>
      {/* ... other sections ... */}

      <section className="product-sec">
        <div className="common-wrap">
          <div className="product-sec-wrap">
            <div className="container">
              <div className="product-title">
                <h6>Aanbod</h6>
                <h2><strong>Onze nieuwste auto's</strong>, klaar voor u.</h2>
                <p>Bij Automotive van Lierop hebben we een uitgebreid en divers assortiment occasions op voorraad. U bent van harte welkom in onze showroom. We raden u aan om van tevoren contact met ons op te nemen, zodat we u alle aandacht kunnen geven die u verdient. Neem alvast een kijkje in ons aanbod!</p>
              </div>

              {/* Swiper Slider for Products */}
              <div className="product-slider position-relative">
                <Swiper
                  modules={[Navigation, Pagination]}
                  speed={1000}
                  navigation={{
                    prevEl: navigationPrevRef.current,
                    nextEl: navigationNextRef.current,
                  }}
                  pagination={{
                    el: ".product-slider .swiper-pagination",
                    type: "fraction",
                    clickable: true,
                  }}
                  onSwiper={(swiper) => {
                    // Delay navigation initialization until Swiper instance is created
                    setTimeout(() => {
                      swiper.params.navigation.prevEl = navigationPrevRef.current;
                      swiper.params.navigation.nextEl = navigationNextRef.current;
                      swiper.navigation.init();
                      swiper.navigation.update();
                    });
                  }}
                  breakpoints={{
                    320: {
                      slidesPerView: 1,
                      spaceBetween: 10,
                      centeredSlides: true,
                    },
                    767: {
                      slidesPerView: 1,
                      spaceBetween: 20,
                    },
                    992: {
                      slidesPerView: 2,
                      spaceBetween: 25,
                    },
                    1200: {
                      slidesPerView: 3,
                      spaceBetween: 25,
                    },
                  }}
                >
                  {products.map((product) => (
                    <SwiperSlide key={product.id}>
                      <Link to="#">
                        <div className="each-product">
                          <div className="each-product-img position-relative">
                            <img src={product.image} alt={product.title} className="w-100" />
                            <div className="product-plus">
                              <img src="assets/product-plus.svg" alt="View details" />
                            </div>
                          </div>
                          <div className="each-product-text">
                            <h3>{product.title}</h3>
                            <p>{product.description}</p>
                            <ul>
                              <li>
                                <h6><strong>Bouwjaar</strong></h6>
                                <h6>{product.year}</h6>
                              </li>
                              <li>
                                <h6><strong>Brandstof</strong></h6>
                                <h6>{product.fuel}</h6>
                              </li>
                              <li>
                                <h6><strong>Transmissie</strong></h6>
                                <h6>{product.transmission}</h6>
                              </li>
                              <li>
                                <h6><strong>{product.price}</strong></h6>
                                <h6>{product.monthly}</h6>
                              </li>
                            </ul>
                          </div>
                        </div>
                      </Link>
                    </SwiperSlide>
                  ))}
                </Swiper>

                {/* Navigation arrows */}
                <div ref={navigationPrevRef} className="swiper-button-prev common-arrow">
                  <img src="/assets/prev.svg" alt="Previous" />
                </div>
                <div ref={navigationNextRef} className="swiper-button-next common-arrow">
                  <img src="/assets/next.svg" alt="Next" />
                </div>
                
                {/* Pagination */}
                <div className="swiper-pagination"></div>
              </div>

              <div className="product-btn">
                <Link to="#" className="common-btn">Bekijk aanbod</Link>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* ... rest of your code ... */}
    </main>
  );
};

export default HomePage;
